STMENTS LTD»  в Україні зареєстровано як юридична особа – ПП “ІФЛК “ІЗРАЇЛЬ ІНВЕСТМЕНС” (код за ЄДРПОУ 42620622). \r\n \r\nПослуги забезпечення діяльності домену надаються компанією «101domain», яка зареєстрована в США, і також надає своїм клієнтам можливість приховати інформацію про них у загальнодоступних Інтернет джерелах. \r\n \r\nНа офіційний запит Комісії про надання інформації від проекту відповідь так і не надійшла. \r\n \r\nКомісія констатує в обох випадках всі ознаки можливого зловживання на ринку фінансових послуг, що несе загрозу введення в оману громадян та втрати ними значних коштів. НКЦПФР вживає всіх законних заходів щоб мінімізувати потенційно протиправну діяльність та попереджає інвесторів про ризики втрати грошей.',0,0,1),(627,'','Christinaparp','christinaparp@hotmail.com',NULL,'Hellо all, guуѕ! Ι know, mу message mаy bе tоо sресifiс,\r\nВut mу ѕіstеr found nісe man herе аnd thеy mаrried, so hоw аbout me?ǃ :)\r\nI аm 25 yеarѕ оld, Сhrіѕtina, frоm Rоmаnia, I know Εnglіѕh and German lаnguаgeѕ аlѕo\r\nАnd... Ι hаve spеcific diѕеаsе, nаmed nуmphomаnіa. Whо knоw what iѕ thіѕ, cаn underѕtаnd mе (better tо saу it іmmediatеlу)\r\nΑh уes, Ι cook verу tаѕty! and Ι lovе not only cооk ;))\r\nIm rеаl girl, not prоstitute, аnd looking fоr serіоus and hоt relаtiоnshір...\r\nΑnуwaу, you саn fіnd mу рrоfile hеre: http://rinewpulyra.gq/user/12447/ \r\n',0,0,1),(628,'','HenryEnrog','henry_777@gmail.com',NULL,'New electronic music. http://0daymusic.org \r\n0day Club Electro LIVE-SETS, Music Videos: \r\nHardstyle, Hardcore, Lento Violento, Italodance, Eurodance, Hands Up \r\nList albums: https://0daymusic.org/FTPtxt/ \r\nNew 0-DAY scene releases daily. \r\nSorted section by date / genre. \r\nMusic scene releases, Premium account. \r\nPrivate FTP Music/Albums/mp3 1990-2022',0,0,1),(629,'','Jeraldmar','sebmal911@wp.pl',NULL,'Gdzie znajdować celuloidy online nadto daremnie? Lista najmilszych miejscowości 2022! \r\n \r\nDokąd patrzyć filmiki online za bezsensownie? Ewiden