INSERT INTO `offre` VALUES (38,'Le B. Retail Park',428,0,'A LOUER, en exclusivité, sur la commune de Le Barp, Local d\'une surface de 428 m2\r\nA proximité des supermarchés SUPER U et LEADER PRICE, WELDOM, MIDAS, GENERATION PISCINE,........\r\nDisponible immédiatement, loyer annuel 48 900 € HT, LOT C1, Bail 3-6-9\r\nHonoraires: 30 % HT sur loyer annuel.','',48900,'oui','oui'),(64,'Le B. Retail Park',385,0,'A LOUER, en exclusivité, sur la commune de Le Barp, Local d\'une surface de 385 m2\r\nA proximité des supermarchés SUPER U et LEADER PRICE, WELDOM, MIDAS, GENERATION PISCINE, GSF,...\r\nDisponible immédiatement, loyer annuel 34 300 € HT, LOT 6, Bail 3-6-9\r\n\r\nHonoraires: 30 % HT sur loyer annuel','',34300,'oui','oui'),(79,'Local commercial',108,0,'EN EXCLUSIVITÉ: Situé à Libourne (33), sur un axe très passant nous vous proposons un ensemble commercial d\'une surface de 334 m2 au sol, disposant de parking, divisible en 3 lots.\r\nLOT A : 108 m2, loyer annuel 26 500 € HT\r\nHonoraires 30 % HT sur loyer annuel soit: 7 950 € HT\r\nLivraison: fin 2023','',26500,'oui','oui'),(81,'LOCAL COMMERCIAL',113,0,'EN EXCLUSIVITÉ, Situé à Libourne (33), sur un axe très passant nous vous proposons un ensemble commercial d\'une surface de 334 m2 au sol, disposant de parking, divisible en 3 lots.\r\nLOT B : 113 m2, loyer annuel 26 500 € HT\r\nHonoraires 30 % HT sur loyer annuel soit 7 950 € HT\r\nLivraison fin 2023','',26500,'oui','oui'),(82,'LOCAL COMMERCIAL',113,0,'EN EXCLUSIVITÉ, Situé à Libourne (33), sur un axe très passant nous vous proposons un ensemble commercial d\'une surface de 334 m2 au sol, disposant de parking.\r\nLOT C : 113 m2, loyer annuel 28 000 € HT\r\nHonoraires 30 % HT sur loyer annuel soit 8 400 € HT\r\nLivraison fin 2023','',28000,'oui','oui'),(84,'BUREAUX ',200,0,'A CENON, au coeur d\'un centre d\'affaires sécurisé, locaux professionnels comprenant 200 m2 de bureaux, cloisonnés et climatisés, fibre optique.\r\n12 places de parking privatives - Bail 3-6-9\r\nDisponible.\r\nLoyer mensuel 2420 € HT + charges\r\nHonoraires : 20 % HT sur loyer annuel','',29040,'oui','oui'),(88,'Local commercial et d\'activité RETAIL PARK ',370,0,'LE BARP (33) Local commercial d\'une surface de 370 m2 neuf, conviendrait à une activité commerciale et professionnelle.\r\nLe local dispose d\'une surface vitrée et à l\'arrière d\'une porte rideau.\r\nParking et aire de livraison.\r\nBail 3-6-9\r\nHonoraires 30 % HT sur le loyer annuel HT\r\nDisponibilité immédiate.','',33100,'oui','oui'),(95,'LOCAUX d\'ACTIVITE PESSAC',343,0,'Au coeur d\'un parc d\'activités en pleine expansion, situé à PESSAC BERSOL, au sein d\'un des principaux pôles tertiaires et technologiques  de l\'agglomération Bordelaise, cet ensemble édifié dans un parc de 4 hectares présente des avantages importants:\r\n-Environnement tertiaire\r\n-Proximité de l\'aéroport de Bordeaux Mérignac\r\n-Transports en commun desservant le site\r\n-Le centre ville de Bordeaux à 20 mn par la rocade\r\n-Parc hôtelier\r\n-360 places de parking, dont 137 en sous-sol avec accès sécurisé.\r\nBail 6 ans fermes\r\nLoyer annuel à partir de 80 € HT le m2 par an pour l\'activité\r\nLoyer annuel à partir de 125 € HT le m2 par an pout les bureaux\r\n\r\nExemple pour un local de 343 m2 comprenant 261 m2 d\'activité et 82 m2 de bureaux le loyer annuel est de 31 130 € HT\r\nDossier complet sur demande\r\n','',31130,'oui','oui'),(97,'A LOUER LOCAL COMMERCIAL',349,0,'EN EXCLUSIVITÉ, A louer local commercial en première ligne, situé avenue du Médoc 33114 Le Barp, aux sein du nouveau retail Park Le B.\r\nLocal commercial, d\'une surface de 349 m2 formant un angle entièrement vitrée, environnement commercial, SUPER U, WELDOM, MIDAS, GENERATION PISCINE, GSF,...\r\nDisponible\r\nHonoraires: 13 500 € HT','',45000,'oui','oui'),(98,'A LOUER A MIOS (33)',224,0,'Au coeur d\'un parc d\'activité situé à MIOS, local à louer, lot N°7, d\'une surface au sol de 190 m2 équipé d\'une mezzanine d\'une surface de 34 m2, bâtiment neuf, disponibilité immédiate, 6 places de parking sont attribuées avec le lot.\r\nLoyer annuel 19 040 € HT\r\nHonoraires: 3 808 € HT\r\nDossier complet sur demande','',19040,'oui','oui'),(99,'BATIMENT D\'ACTIVITE A LOUER A MIOS (33)',217,0,'Au coeur d\'un parc d\'activité situé à MIOS, local à louer, lot N°15, d\'une surface au sol de 183 m2 équipé d\'une mezzanine d\'une surface de 34 m2, bâtiment neuf, disponibilité immédiate, 6 places de parking sont attribuées avec le lot.\r\nLoyer annuel 18 445 € HT\r\nHonoraires: 3 689 € HT\r\nDossier complet sur demande','',18445,'oui','oui'),(101,'Local commercial',45,0,'Local commercial à louer en pied d\'immeuble, programme neuf situé à Villenave d\'Ornon, ligne bus 5-36-87, axe très fréquenté.\r\nSurface 35,04 m2 de surface de vente + 10,91 m2 de réserve\r\nLivraison fin 2024.\r\nLocal livré brut, fluides en attente, vitrines posées.\r\nTaxe foncière à la charge du preneur.\r\nLoyer mensuel: 1050 € HT\r\nHonoraires d\'agence: 30 % HT sur loyer annuel HT soit 3 780 € HT','',12600,'oui','oui'),(102,'Local commercial',92,0,'Local commercial à louer en pied d\'immeuble, programme neuf situé à Villenave d\'Ornon, ligne bus 5-36-87, axe très fréquenté.\r\nSurface 59,54 m2 de surface de vente + 33,38 m2 de réserve\r\nLivraison fin 2024.\r\nLocal livré brut, fluides en attente, vitrines posées.\r\nTaxe foncière à la charge du preneur.\r\nLoyer mensuel: 1500 € HT\r\nHonoraires d\'agence: 30 % HT sur loyer annuel HT soit 5400 € HT','',18000,'oui','oui'),(103,'Locaux commerciaux à Villenave d\'Ornon',137,0,'Locaux commerciaux à vendre en pied d\'immeuble, programme neuf, à Villenave d\'Ornon, sur un axe très fréquenté, ligne bus, loués 30 600 € HT/an\r\nHonoraires d\'agence: 5 % HT 21 850 € HT','',437000,'oui','oui'),(104,'Local commercial',242,0,'33260 LA TESTE DE BUCH\r\nAu cœur de la zone d’activité très dense, \r\nproche du centre commercial Leclerc \r\nExcellente Visibilité.\r\nLocal commercial disposant d’une surface de \r\n242 m2 soit 168 m2 au sol et 74 m2 de mezzanine.\r\nLoyer HT/HC : 2500 €\r\nProvisions sur charges : 150 € HT\r\nBail 3-6-9\r\nTaxe foncière à la charge du preneur.\r\nDépôt de garantie: 2 mois\r\nHonoraires d’agence: 20 % HT sur loyer annuel \r\nSoit 6000 € HT\r\nDisponibilité immédiate\r\n','',30000,'oui','oui'),(111,'Local de stockage',284,0,'A CENON, Local de stockage d\'une surface de 284 m2, équipé de deux portes rideaux électriques, local sécurisé dans un site également sécurisé avec portail.\r\nConviendrait parfaitement à un collectionneur de voitures, motos,...\r\nLe local est équipé de sanitaires, d\'une mezzanine, et de local pouvant servir d\'atelier.\r\nBail 3-6-9\r\nHonoraires d\'agence 20 % HT sur loyer annuel','',30000,'oui','oui'),(112,'Bureaux',464,0,'Remarquables bureaux, situés dans le quartier Fondaudège bénéficiant de 3 étages à proximité du tramway bordelais. \r\n\r\n11 caves, d\'une superficie moyenne de 30m2\r\nCour intérieur de 230m2 environ\r\n3 étages avec de beaux volumes\r\n\r\nAccès voiture, possibilité de se garer dans la cour, sécurisée. \r\n\r\nVidéo sur demande, pour tout renseignements supplémentaires, contactez-nous. \r\n','',4500000,'oui','oui'),(114,'Local professionnel ',10,0,'Local d\'environ 10m2, pouvant acceuillir profession libéral type Ostéopathe, Masseur, Psychologue, Naturopathe...\r\n\r\n350 euros / mois CC\r\n\r\nIdéalement situé, dans le centre de Saint-Sulpice et Cameyrac, proximité des commerces, parking...\r\n\r\nVisites et informations complémentaires sur demande. \r\n\r\nDisponibilité immédiate. \r\n','',350,'oui','oui'),(115,'Local commercial BARP',97,0,'A LOUER, en exclusivité, sur la commune de Le Barp, Local d\'une surface de 97 m2\r\nA proximité des supermarchés SUPER U et LEADER PRICE, WELDOM, MIDAS, GENERATION PISCINE, GSF,...\r\nDisponible immédiatement, loyer annuel 18 000 € HT, division du Lot 9\r\nBail 3-6-9\r\n','',1500,'oui','oui'),(116,'Local commercial BARP',121,0,'A LOUER, en exclusivité, sur la commune de Le Barp, Local d\'une surface de 121 m2\r\nA proximité des supermarchés SUPER U et LEADER PRICE, WELDOM, MIDAS, GENERATION PISCINE, GSF,...\r\nDisponible immédiatement, loyer annuel 20 400€ HT/an, division du Lot 9\r\nBail 3-6-9','',1700,'oui','oui');
