INSERT INTO `offre_part` VALUES (104,'Villa Mérignac',120,0,'A vendre à Mérignac, quartier résidentiel, proche accès rocade, villa T5, comprenant au rdc, un grand séjour, cuisine, cellier, WC.\r\nA l\'étage, 3 chambres, une suite parentale avec douche italienne, une salle de bains familiale, WC.\r\nGarage et jardin clos.\r\nLes travaux ont démarré, livraison fin du premier trimestre 2022.','',496000,'A','A','non','oui'),(105,'Maison T4',103,0,'Terr\'Acotta est un programme de 6 villas T4, avec garage et place de midi, en pleine propriété.\r\nLes villas sauront vous séduire par la qualité de leurs prestations et leurs agencements idéalement pensés :\r\n\r\n=> Jardins plantés, cloturés et équipés d\'une terrasse bois avec pergola\r\n=> Volets roulants motorisés avec commande radio\r\n=> Climatisation réversible dans le séjour\r\n=> Suite parentale avec dressing et salle d\'eau.\r\n','',549000,'A','A','non','oui'),(106,'VILLA ANDROMEDE - ARTIGUES-PRÈS-BORDEAUX',110,0,'Villas Andromède , c\'est un programme de 16 villas Premium de 4 et 5 pièces toutes équipées d\'un étage, d\'un garage, 2 stationnements extérieurs aménagés au centre-bourg d\'Artigues-Près-Bordeaux .\r\nMitoyennes d\'un seul côté (par le garage), et dans un domaine complètement clos, ces habitations réservent à leurs occupants toute l\'intimité, la verdure et le calme de l\'Entre-Deux-Mers avec commerces et services urbains accessibles à pieds .\r\n=> Accession en pleine propriété\r\n=> Domaine sécurisé\r\n=> Jardins plantés, clôturés, et équipés d\'une terrasse bois avec pergola\r\n=> Piscines 5 x 3 sur certaines typologies\r\n=> Prestations et équipements grand confort\r\n=> Parcelles de 280 à 540m²\r\n=> Architecture contemporaine, toits terrasses végétalisées','',539000,'A','A','non','oui'),(107,'Maison familiale',149,0,'Dans un environnement calme, proche du centre bourg, des transports et de toutes ses commodités, maison familiale de plein pied d\'une surface habitable d\'environ 149m2. \r\nElle se compose d\'une spacieuse et lumineuse pièce de vie de plus de 47m2 avec une salle à manger, une cuisine ouverte équipée de 14m2, cheminée et poêle à bois intégré avec accès terrasse/jardin et piscine. \r\nDe 4 chambres dont une avec salle d\'eau. \r\nD\'une chambre parentale avec dressing, douche à l\'italienne, double vasque, sèche serviettes. \r\nUne salle de bain avec baignoire, double vasque, sèche serviette ainsi que des WC. \r\nEspace bureau, ainsi qu\'un cellier/buanderie. \r\n\r\nA l’extérieur, sur une parcelle de près de 2400m2 entièrement clôturée, arborée et verdoyante, un grand garage d\'une surface de 45m2 environ et une piscine sécurisée avec sa terrasse. \r\n\r\nChauffage aérothermique réversible, double vitrage, fibre, clim réversible, panneaux solaires dernière génération installés en janvier dernier. \r\n\r\nDiagnostiques réalisés ok \r\n\r\nPrix de vente : 505 000 € \r\nHonoraires charge vendeur \r\n\r\n\r\nPour toutes informations complémentaires, ainsi que des photos supplémentaires, contactez moi au :\r\n06 03 33 77 78 \r\nAgence VotreImmopro','',485000,'B','C','non','oui'),(108,'Maison individuelle',140,0,'Maison de plein pied d\'environ 140m2 sur un terrain d\'une superficie de 720m2. En bordure de foret, dans un quartier résidentiel, calme et verdoyant. A 2 min du centre bourg de Margaux-Cantenac, a 5 minutes de Soussans. \r\nPortail coulissant électrique avec vidéophonie connecté/vidéosurveillance. \r\nMaison composée d\'un hall d\'entrée avec placard et WC, d\'une pièce à vivre, salon, cuisine d\'environ 47m2 avec 2 baies vitrées coulissantes, salon cheminée demi-lune avec insert.\r\nLa cuisine, équipée avec comptoir bar donnant sur le salon. \r\nUne chambre parentale avec salle d\'eau, douche à l\'italienne, WC. \r\n3 chambres supplémentaires, une salle de bain avec baignoire ainsi qu\'une 4ème pièce pouvant servir de local professionnel ou salle de jeux avec entrée/sortie indépendante.\r\nBureau, cellier équipé d\'une chaudière à gaz.\r\nMezzanine de 12m2, buanderie/garage avec sortie sur le jardin. \r\n\r\nPetite terrasse bois avec barbecue en pierre.\r\nVolet électrique, fibre, cabanon dans le jardin\r\n\r\nHonoraire charge vendeur. \r\n\r\nPour toutes informations complémentaires, visites, et photos :\r\n06 03 33 77 78\r\n','',338000,'C','C','non','oui'),(111,'Hotel particulier',448,0,'Hotel particulier situé dans le quartier Palais Galien/Saint Seurin offrant une belle surface de 448m2 sur 2 étages disposant d\'un petit jardin ainsi qu\'une piscine. \r\n\r\nTravaux de rénovation à prévoir, déjà commencé, à terminer. \r\nQuartier calme et sécurisant. \r\n\r\nPhotos et vidéos sur demande. Pour tout renseignements et chiffrage des travaux, nous contacter. \r\n','',2490000,'','','oui','oui'),(112,'Terrain Arcachon',1055,0,'Terrain à vendre à Arcachon, dans le quartier Pereire. \r\nPossibilité de construire une maison d\'une surface maximum de 264m2. \r\nPossibilité R+1\r\n\r\nDossier sur demande','',1260000,'','','oui','oui'),(113,'Villa Hossegor',6000,0,'Somptueuse Villa à Soorts-Hossegor de 450m2 sur un parc arboré de 6000m2. \r\nPossibilité de le diviser afin d\'y construire une seconde Villa. \r\nEn première ligne, entre lac et mer, Villa construite dans la période d\'entre deux guerres par l\'architecte GOMEZ.\r\nPropriété remarquable\r\n\r\nDossier sur demande ','',8900000,'','','oui','oui'),(114,'Domaine SOLOGNE',4000000,0,'Somptueux Domaine en Sologne \r\n\r\nSitué dans le département du Loiret (45), à 1h40 du centre de Paris, 1h d\'Orleans,\r\nDomaine de 400ha, comprenant 8 étangs, de nombreuses forêt, surface de culture à gibier, structure équestre, piscine, terrain de tennis, piste d\'hélicoptère, parking souterrain, oeuvres d\'art...\r\n\r\nDossiers, vidéos, et plus d\'informations sur demande.','',21000000,'','','oui','oui'),(115,'Terrain viabilisé',1160,0,'Terrain viabilisé, d\'une superficie de 1160m2 sur les hauteurs de Latresne. \r\nQuartier calme et arboré. \r\nDossier sur demande.\r\n\r\n','',483000,'','','oui','oui'),(116,'Terrain Latresne',1170,0,'Terrain viabilisé, d\'une superficie de 1170m2 sur les hauteurs de Latresne. \r\nQuartier calme et arboré. \r\nDossier sur demande.','',483000,'','','oui','oui');
